import React from 'react';
import {OverlayView} from '@react-google-maps/api'
export default function CustomMarker({features})
{
    const center = { lat: features.lat, lng: features.long }
    const [info,setInfo] = React.useState(false);
    if(info == false)
    return(
    <OverlayView
        position={center}
        mapPaneName={OverlayView.OVERLAY_MOUSE_TARGET}
>
        <div className="marker">
            <img src="https://cdn-icons-png.flaticon.com/128/684/684908.png" alt="" className="header-img"/>
        </div>
    </OverlayView>
    )
    else
    return(
        <OverlayView
            position={center}
            mapPaneName={OverlayView.OVERLAY_MOUSE_TARGET}
    >
            <div className="marker">
                <img src="https://cdn-icons.flaticon.com/png/128/6153/premium/6153497.png?token=exp=1652694656~hmac=cdd41349ab9d69cb1a6f63ad27070dea" alt="" className="header-img"/>
            </div>
        </OverlayView>
        )
}
